const Candidate = (props) => {
  return (
    <tr>
      <td>{props.name}</td>
      <td>{props.address}</td>
      <td>{props.social_number}</td>
      <td>{props.category}</td>
      <td>
        <button>Delete</button>
      </td>
    </tr>
  );
};

export default Candidate;
